transaction.handlers:
// Handles the XML generated event.
function onXmlGenerated() {
	var auth = dom.getElementsByTagName("document").item(0).getFirstChild().getNodeValue();
	var start = auth.indexOf("Auth=")+5;
	auth = "GoogleLogin auth=" + auth.substring(start, auth.length()-1);
	log.message(auth);
	context.set("GoogleAuth", auth);
}

function onTransactionStarted() {

	var _context = context;
	var _log = log;
	
	context.set("GoogleHeader",
	
            function () {
            
				// retreive from context the current Google Auth set by the login transaction
				var header = _context.get("GoogleAuth");
				_log.message("Auth retrieved : " + header);
				
				// get contexts connector and its current http headers
				var connector = _context.getConnector();
				var httpParameters = connector.httpParameters;
				
				// remove all current headers
				httpParameters.removeAllElements();
				
				// Create a new header set and add the google auth header
				var xmlv = new Packages.com.twinsoft.convertigo.beans.common.XMLVector();
				xmlv.add("Authorization");
				xmlv.add(header);
				httpParameters.add(xmlv);
			
				// Create a new header set and add the api Version header
				var xmlv = new Packages.com.twinsoft.convertigo.beans.common.XMLVector();
				xmlv.add("GData-Version");
				xmlv.add("3.0");
				httpParameters.add(xmlv);
				
				//Create a new header set and add the content type header
				var xmlv = new Packages.com.twinsoft.convertigo.beans.common.XMLVector();
				xmlv.add("Content-Type");
				xmlv.add("application/atom+xml");
				httpParameters.add(xmlv);
				
				// replace the connectors headers with the new set 
				connector.httpParameters = httpParameters;
				
				// display in trace the new headers
				_log.message("httpParam : " + connector.httpParameters);

            }
            
      );
      
}

// Handles the transaction start event.
function onTransactionStarted() {
	// retreive from context the current Google Auth set by the login transaction
	var header = context.get("GoogleAuth");
	
	// get contexts connector and its current http headers
	var connector = context.getConnector();
	var httpParameters = connector.httpParameters;
	
	// remove all current headers
	httpParameters.removeAllElements();
	
	// Create an new header set and add the google auth header
	var xmlv = new Packages.com.twinsoft.convertigo.beans.common.XMLVector();
	xmlv.add("Authorization");
	xmlv.add(header);
	httpParameters.add(xmlv);

	// Create an new header set and add the api Version header
	var xmlv = new Packages.com.twinsoft.convertigo.beans.common.XMLVector();
	xmlv.add("GData-Version");
	xmlv.add("3.0");
	httpParameters.add(xmlv);
	
	// replace the connectors headers with the new set 
	connector.httpParameters = httpParameters;
	
	// display in trace the new headers
	log.message("httpParam : " + connector.httpParameters);
	
	// override host based url
	connector.sUrl = "http://docs.google.com/feeds/default/private/full";
}

